virtual_res_shortnames.forEach(def => {
  nameDefs.push(def);
});

const renderResults = (keyword = '', searchTarget) => {
  let searchResults = [];
  if (!keyword) searchResults = nameDefs;
  else {
    if (searchTarget === 'shortName') {
      searchResults = searchShortName(keyword);
    } else if (searchTarget === 'longName') {
      searchResults = searchLongName(keyword);
    } else if (searchTarget === 'occursIn') {
      searchResults = searchOccursIn(keyword);
    } else if (searchTarget === 'category') {
      searchResults = searchCategory(keyword);
    } else if (searchTarget === 'any') {
      searchResults = searchAny(keyword);
    }
  };

  const table = document.getElementById('result-table');
  table.innerHTML = '';
  table.insertRow();
  table.rows[0].innerHTML = `<td>short name</td> <td>long name</td> <td>occurs in</td>  <td>category</td>  <td>TS</td>`;

  const resultTable = document.createElement('table');

  searchResults.forEach(def => {
    const row = resultTable.insertRow();
    const shortNameCell = row.insertCell();
    const longNameCell = row.insertCell();
    const occursInCell = row.insertCell();
    const categoryCell = row.insertCell();
    const tsCell = row.insertCell();

    const { shortName, longName, occursIn, category, TS } = def;
    shortNameCell.innerHTML = shortName;
    longNameCell.innerHTML = longName;
    occursInCell.innerHTML = occursIn;
    categoryCell.innerHTML = category;
    tsCell.innerHTML = TS;
    table.append(row);
  });
};

const searchAny = (keyword) => {
  const { keyShortName, keyLongName, keyOccursIn, keyCategory } = keyword;
  console.log('keywords: ', keyShortName, keyLongName, keyOccursIn, keyCategory);
  if (!keyShortName && !keyLongName && !keyOccursIn && !keyCategory) {
    console.log('no search keyword is provided');
    return nameDefs;
  }

  const results = [];
  for (const nameDef of nameDefs) {
    const { shortName, longName, occursIn, category, TS } = nameDef;
    const lowLongName = longName.toLowerCase();
    const lowOccursIn = occursIn.toLowerCase();
    const lowCategory = category.toLowerCase();

    const { keyShortName, keyLongName, keyOccursIn, keyCategory } = keyword;
    const lowKeyLongName = keyLongName ? keyLongName.toLowerCase() : '';
    const lowKeyOccursIn = keyOccursIn ? keyOccursIn.toLowerCase() : '';
    const lowKeyCategory = keyCategory ? keyCategory.toLowerCase() : '';

    let matched = true;
    if (keyShortName && shortName !== keyShortName)
      continue;
    if (keyLongName && !lowLongName.includes(lowKeyLongName))
      continue;
    if (keyOccursIn && !lowOccursIn.includes(lowKeyOccursIn))
      continue;
    if (keyCategory && !lowCategory.includes(lowKeyCategory))
      continue;

    results.push(nameDef);
  }
  return results;
}

const searchAnyHandler = () => {
  const keyword = {
    keyShortName: document.getElementById('filter-shortname').value,
    keyLongName: document.getElementById('filter-longname').value,
    keyOccursIn: document.getElementById('filter-occursin').value,
    keyCategory: document.getElementById('filter-category').value
  };
  renderResults(keyword, 'any');
};

searchBtn.addEventListener('click', searchAnyHandler);

function pressEnter() {
  if (window.event.keyCode == 13) {
    searchAnyHandler();
  }
}